import React from "react";
import { useNavigate } from "react-router-dom";

const Navbar = ({ handleLogout }) => {
  const navigate = useNavigate(); // Get navigate function

  const handleHomeClick = () => {
    navigate("/"); // Navigate to the home page
  };

  const handleDashboardClick = () => {
    navigate("/dashboard"); // Navigate to the dashboard page
  };

  const handleAdminClick = () => {
    navigate("/admin"); // Navigate to the admin page
  };

  const handleLoginClick = () => {
    navigate("/login"); // Navigate to the login page
  };

  const navbarStyle = {
    display: "flex",
    justifyContent: "flex-end",
    alignItems: "center",
    backgroundColor: "#333",
    padding: "10px 20px",
  };

  const buttonStyle = {
    backgroundColor: "transparent",
    border: "none",
    color: "white",
    fontSize: "16px",
    cursor: "pointer",
    marginLeft: "10px",
  };

  const handleLogoutClick = () => {
    handleLogout(); // Call handleLogout function passed from parent
  };

  return (
    <div style={navbarStyle}>
      <button style={buttonStyle} onClick={handleHomeClick}>
        Home
      </button>
      <button style={buttonStyle} onClick={handleDashboardClick}>
        Dashboard
      </button>
      <button style={buttonStyle} onClick={handleAdminClick}>
        Admin
      </button>
      <button style={buttonStyle} onClick={handleLoginClick}>
        Login
      </button>
      <button style={buttonStyle} onClick={handleLogoutClick}>
        Logout
      </button>
    </div>
  );
};

export default Navbar;
